import React from 'react';
import { StyleSheet, Text, View } from 'react-native';

export default function App() {
  return (
    <View style={styles.container}>
      <Text style={styles.textCenter}>Hello World asdassssss</Text>
      <Text style={[styles.textRed,styles.textCenter]}>Mobile Computing</Text>
    </View>
  );
}

const styles = StyleSheet.create({

  container:{
    backgroundColor:"#2980b9"
  },


  textCenter:{
    textAlign:"center",
    padding:25,
    fontSize:20

  },

  textRed:{
    color:"red"
  }

});
